(744, '2024-04-23', 'rated', 0, 'GP-06-181', 'Rolle, Ryan', 'r.rolle@glorylocal.com.ph', 'Parts Production', NULL, 'mis', 'Others', 'My grpis is not working properly just today, it seems that all my uploaded filed are not bieng accepted by the system eventhough it says it is successful. No records have been found after uploading.', '', '', '', '105', 'Sapalasan, Eloisa', '2024-04-23', '', NULL, '', '2024-04-23', '2024-05-02', 'GP-23-822', 'Christian John Lopez', NULL, '2024-04-24', 'Review the full details of requestor concern in the system.', 'Troubleshoot the function of the system by doing the same process that the requestor did and review the system on why that occurs.', NULL, 'April 24, 2024', 'April 24, 2024', NULL, 'The problem only occurs on that client side, so the solution that I made is to reset/clear his browser cache to let the latest function of code in the system to load and giving a basic troubleshoot so it will lessen to encounter again.', '', 0, NULL, NULL, '5', '5', 5.00, '2024-04-24', 'Rolle, Ryan', NULL, NULL, 'Thank you very much for your very immediate response.', 'Apr', '2024', '', NULL, NULL, NULL, 'True', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
